import SearchResultFavorites from '../searchResultFavorites'
import styles from './searchResults.module.scss'

const Favorites = () => {
const msgRef = useRef<HTMLParagraphElement>(null)


  return (
    <div className={styles.favoriteResultsWrapper}>
      <ul>
        <SearchResultFavorites />

        <h1 className={styles.endMsg} ref={msgRef}>
          마지막 검색 결과입니다
        </h1>
      </ul>
    </div>
  )
}

export default Favorites
